import { List, Typography, TypographyProps } from 'antd';

const { Title, Text } = Typography;

function SystemList() {
  const data = [
    'Công tyCP DVDL Phú Thọ',
    'Khu du lịch sinh thái Vàm Sát',
    'Khách sạn Ngọc Lan',
    'Khách sạn Phú Thọ',
    'Trung tâm Du Lịch Đầm Sen',
  ];
  return (<>
    <List
      dataSource={data}
      renderItem={(item) => (<List.Item>
        <Title></Title>
        <Text>{item}</Text>
      </List.Item>)}
    />
  </>);
}
export default SystemList;
